import React, { useState, useEffect } from "react";
import axios from "axios";
function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        fetch("/fakeData")
            .then((res) => res.json())
            .then((data) => {
                setData(data);
                console.log(data);
            });
    }, []);

    return (
        <div>
            {data.data.map((d, i) => {
                console.log(d);
            })}
        </div>
    );
}

export default App;
